import React from 'react';

import { User } from '../user/user.comp';
import { H3 } from '../heading/heading.comp';
import { NinjaIcon, SystemIcon } from '../../../external/components/icon/icon.comp';
import { pluginsList } from '../../../external/types/component.types';
import { IUserProps } from '../user/user.comp';
import { TPlatform } from '../../../external/types/editor.types';
import { useQuery } from '../../../external/hooks/query.hook';

import './appHeader.scss';

interface AppHeaderProps {
  componentName: string
  userProps: IUserProps
  hidePoweredBy?: boolean;
  logoImageUrl?: string
  logoUrl?: string
  anonymousUser?: boolean
  vendor?: TPlatform
}

const logo = 'data:image/png;base64,';

export const AppHeader = (props: AppHeaderProps) => {
  const { componentName, logoUrl, logoImageUrl, hidePoweredBy, anonymousUser, userProps, vendor } = props;
  const { componentType } = userProps;
  const query = useQuery();
  const ninjaIcon: any = pluginsList.filter((p) => p.name === componentType)?.[0]?.iconClass;
  const isPlugin = componentType && (logoImageUrl === 'string' || ninjaIcon);

  return (
    <header id="app-header">
      <div className="app-top-header">
        <div className="inner wrapper flex-wrapper">
          <figure className="logo">
            {
              isPlugin ? 
              <div className="flex-wrapper plugin">
                <a href={logoUrl || '/'}>
                  {
                    typeof logoImageUrl === 'string' ? 
                    <img src={logoImageUrl} alt={componentName} /> : 
                    <NinjaIcon type={ninjaIcon} />
                  }
                </a>
                <H3 accented={true}><a href={logoUrl || '/'}>{componentName}</a></H3>
                {
                  !hidePoweredBy &&
                  <p className="powered-by">
                    <span>/ &nbsp; </span>by &nbsp;<a href="https://www.commoninja.com/" target="_blank" rel="noopener noreferrer" title="Common Ninja">Common Ninja</a>
                  </p>
                }
              </div> :
              <a href={logoUrl || '/'} className="flex-wrapper">
                <img src={logo} alt="Common Ninja" />
              </a>
            }
          </figure>
          {
            !anonymousUser &&
            <nav className="flex-wrapper">
              <User {...userProps} />
            </nav>
          }
          {
            (vendor === 'duda' || vendor === 'shopify' || vendor === 'bigcommerce' || vendor === 'shift4shop') &&
            <nav className="flex-wrapper">
              <a title="Back to Dashboard" className="dashboard-link" rel="noopener noreferrer" href={`/${vendor}/dashboard/${componentType}?${query.toString()}`}>
                <SystemIcon type="arrow-left" size={16} /> Back to Dashboard
              </a>
            </nav>
          }
        </div>
      </div>
    </header>
  );
}
